import styled from "styled-components";

export const ContactPageContainer = styled.div`
  width: 75%;
  min-height: 90vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 50px auto 0;
`;

export const HeadofficeSection = styled.div`
  width: 100%;
  padding: 10px 0;
  display: flex;
  justify-content: space-between;
`;
